		["Gorefiend Digest Timers"] = {
			["outline"] = false,
			["fontSize"] = 33,
			["xOffset"] = -475.000424479595,
			["displayText"] = "%c",
			["customText"] = "--display\nfunction()\n    \n    aura_env.returnString = \"\" -- this is the string that will display the table\n    \n    for k,v in pairs(aura_env.hasDebuffTable) do -- for every item in this table\n        --print (k,v)\n        local value = v\n        local timer = string.format(\"%.1f\",  aura_env.debuffTimer[k] - GetTime()) -- store the timer for the first person\n        local timerColor = \"\"\n        \n        if tonumber(timer) >= 10 then -- red #eb260a\n            timerColor = \"|cFFEB260A\" .. timer .. \"|r\"\n            value = \"|cFFEB260A\" .. value .. \"|r\"\n        \n        \n        \n       else-- if  tonumber(timer) <= 10 then -- green #47dc38\n            timerColor = \"|cFF47DC38\" .. timer .. \"|r\"\n            value = \"|cFF47DC38\" .. value .. \"|r\"\n        end\n        \n        \n        aura_env.returnString = aura_env.returnString .. \"\\124n\".. string.format(\"%s - %s\", timerColor, value)  -- store the information on the display string\n        \n        \n        \n        if tonumber(timer) <= .1 then -- check if the timer is expired\n            table.remove(aura_env.debuffTimer, k) -- remove the items from the table.\n            table.remove(aura_env.hasDebuffTable, k)\n        end\n        \n        \n    end\n    \n    \n    \n    return aura_env.returnString -- return the table.\nend\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n",
