			["customText"] = "function()\n    return iconText\nend\n\n\n\n\n\n\n\n",
			["untrigger"] = {
				["showOn"] = "showAlways",
				["custom"] = "function()\n    local currSpec = GetSpecialization()\n    local _,specName,_,_,_,_ = GetSpecializationInfo(currSpec)\n    local tarHP = UnitHealth(\"target\")\n    local tarCurrHP = UnitHealth(\"target\")\n    local tarMaxHP = UnitHealthMax(\"target\")\n    local tarHP = tarCurrHP / tarMaxHP * 100\n    if UnitExists(\"target\") then\n        if tarHP == 0 then\n            ksTriggered = false\n            return true\n        elseif specName==\"Beast Mastery\" and tarHP>20 then\n            ksTriggered = false\n            return true\n        elseif specName==\"Marksmanship\" and tarHP>35 then\n            ksTriggered = false\n            return true\n        else\n            ksTriggered = true\n            return false\n        end\n    else\n        ksTriggered = false\n        return true\n    end\nend\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n",
