				["event"] = "Cooldown Progress (Spell)",
				["custom"] = "function()\n    ksSpell = \"Kill Shot\" -- Name of the spell \n    local ksSpellName,_,ksSpellIcon,_,_,_ = GetSpellInfo(ksSpell)\n    local currSpec = GetSpecialization() -- Gets which active spec (1 or 2)\n    local _,specName,_,_,_,_ = GetSpecializationInfo(currSpec) -- Spec name\n    local tarCurrHP = UnitHealth(\"target\") -- Targets current HP level\n    local tarMaxHP = UnitHealthMax(\"target\") -- Targets max HP level\n    local tarHP = tarCurrHP / tarMaxHP * 100 -- Percent level of targets HP\n    ksTriggered = false -- Used to trigger the Kill Shot CD Weak Aura\n    if UnitExists(\"target\") then\n        if specName==\"Beast Mastery\" and tarHP<=20 and tarHP ~= 0 then\n            ksTriggered = true  --if BM, at KS health but not dead\n            return true\n        elseif specName==\"Marksmanship\" and tarHP<=35 and tarHP ~= 0 then\n            ksTriggered = true -- if MM, at KS health but not dead\n            return true\n        else\n            ksTriggered = false -- if above condtions were false\n            return false\n        end\n    else\n        return false\n    end\nend\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n",
